import './Login.css';
import React, { Component } from "react";

class Login extends Component {

    sendLogin(){
        const restURL = "http://localhost:8081/race/rest/login/"+this.state.username+"/";
        fetch(restURL, {
            headers: {
                mode: 'no-cors',
                method: "POST",
                'Content-Type': 'application/json',
            }
        })
    }


    constructor(props) {
        super(props);
        this.state = {
            username : "",
            password : ""
        }
    }

    componentDidMount() {
        //this.fetchData()
        //console.log(this.state.profileData)
    }
    render() {
        return (
            <div className="Login">
                <h2>Login</h2>
                <div className="username">
                    <p>Username : </p>
                    <input type="text" className="username-input" />
                </div>
                <div className="password">
                    <p>Password : </p>
                    <input type="password" className="password-input" />
                </div>
                
                <button className="login-button" onClick={this.sendLogin}>Login</button>
            </div>
        )
    }
}

export default Login;
